function login(){var e=document.getElementsByTagName("input")[0].value,t=document.getElementsByTagName("input")[1].value;firebase.auth().signInWithEmailAndPassword(e,t).then(e=>{window.location.href="/index.html"}).catch(e=>{e.code;var t=e.message;alert(t)})}function register(){var e=document.getElementsByTagName("input")[0].value,t=document.getElementsByTagName("input")[1].value;firebase.auth().createUserWithEmailAndPassword(e,t).then(e=>{window.location.href="/index.html"}).catch(e=>{e.code;var t=e.message;alert(t)})}